    fetch(`https://api.github.com/users/${username}`)
    .then(response => response.json())
    .then(response => {
      console.log(response);
      return response;
    })
  }


  render() {
    return (
      <div className="App">
        <header className={"app-header"}>
        </header>

      </div>
    );
  }
}

export default App;
